import React from 'react';

const Education = () => {
  return (
    <div name='Education' className='w-full h-screen bg-[#0a192f] text-gray-100'>
      <div className='flex flex-col justify-center items-center w-full h-full'>
          <div className='sm:text-center font-helvetica'>
            <p className='text-4xl font-bold'>EDUCATION</p>
          </div>            
            <div className='sm:text-center font-bold font-helvetica'>
              <p className = 'text-2xl'>University of Maryland, College Park</p>
              <p className = 'text-2xl'>B.S. Computer Science</p>
              <p className = 'text-1xl'> Expected Graducation: May 2024</p>
          </div>
          <div className = 'sm:text-center font-bold font-helvetica'></div>
        </div>
      </div>
  );
};

export default Education;
